import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Carousel } from 'react-bootstrap';
import Scarf1 from './Assets/scarf1.JPG';
import Scarf2 from './Assets/scarf2.JPG';
import Scarf3 from './Assets/scarf3.JPG';
import Navigation from './Navigation'

function Home() {
  return (

<div className='home'>
<Navigation/>
<Navbar className="color-nav" variant="light">
          <Navbar.Brand href="home">NatureKnitter</Navbar.Brand>
          <Nav>
            <Button variant="light">Products</Button>
          </Nav>
          <div class="divider"/>
          
          <Nav>
              <Button variant="light">
               <Link to="/about">
               About
               </Link>
              </Button>
          </Nav>
        </Navbar>

    <h1>NatureKnitter</h1>

      <div className = "caro">


      <Carousel>
  <Carousel.Item>
    <img className="scarfa"
      src={Scarf1}
      width={800}
      height={545}
      alt="First slide"
      />
    <Carousel.Caption>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img className="scarfb"
      src={Scarf2}
      width={800}
      height={545}
      alt="Second slide"
      />
    <Carousel.Caption>
    </Carousel.Caption>
  </Carousel.Item><Carousel.Item>
    <img className="scarfc"
      src={Scarf3}
      width={800}
      height={545}
      alt="Third slide"
      />
    <Carousel.Caption>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel>

    </div>
      </div>
  );
}

export default Home;
